Home Office Announces Changes to UK Immigration Rules

The introduction of a new immigration route for poultry workers;

The grant of non-visa national status to citizens of Colombia, Guyana and Peru;

An expansion of the Hong Kong BN(O) Household Member Route for adult children;

@2014Janet @JohnPasalis In Hong Kong there are people living in cages. Great example. We should be like them.

House prices in Tokyo have been flat for decades because they have no immigration.

House prices in Toronto have increased 500% in 20 years. The city did not become 500% better; it got worse.
